import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'auto',
  },
  table: {
    minWidth: 700,
  },
});

let id = 0;
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}

const rows = [
  createData('教学楼', 159, 6.0, 24, 4.0),
  createData('教室', 237, 9.0, 37, 4.3),
  createData('教室类型', 262, 16.0, 24, 6.0),
  createData('容量', 305, 3.7, 67, 4.3),
];

function SimpleTable(props) {
  const { classes, afternoonItems, nightItems } = props
  console.log(nightItems)
  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell>教学楼</TableCell>
            <TableCell align="right">教室</TableCell>
            <TableCell align="right">教室类型</TableCell>
            <TableCell align="right">类型</TableCell>
            <TableCell align="right">容量</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {afternoonItems.map(row => (
            <TableRow key={row.id}>
              <TableCell component="th" scope="row">
                {row.date}
              </TableCell>
              <TableCell align="right">{row.time}</TableCell>
              <TableCell align="right">{row.roomName}</TableCell>
              <TableCell align="right">{row.type}</TableCell>
              <TableCell align="right">{row.size}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

export default withStyles(styles)(SimpleTable)
